//popUp
var btnNav = document.querySelector(".nav__item-button");
var closeBtn = document.querySelector(".modal__top--close");
var mobileBtn = document.querySelector(".mobileBtn");
var popUp = document.querySelector(".popUp");
var btns = [btnNav, closeBtn, mobileBtn];
btns.forEach(function (item) {
  item.addEventListener("click", function () {
    console.log('active');
    popUp.classList.toggle("active");
  });
});

//burger
var burgerBtn = document.querySelector(".nav__burger");
var mobileMenuClose = document.querySelector(".mobile__close");
var mobileMenu = document.querySelector(".mobile__list");
var btnsMobile = [burgerBtn, mobileMenuClose];
btnsMobile.forEach(function (item) {
  item.addEventListener("click", function () {
    mobileMenu.classList.toggle("activeBurger");
  });
});

//движение заднего фона от курсора
var movementStrength = 225;
var width = movementStrength / window.innerWidth;
document.querySelector("body").addEventListener("mousemove", function (e) {
  var pageX = e.pageX - window.innerWidth / 2;
  var newvalueX = width * pageX * -1 - 25;
  document.querySelector("body").style.backgroundPosition = newvalueX + "px";
});

//запретить отправку сообщения
var submitBtm = document.querySelector(".modal__btn");
submitBtm.addEventListener("click", function (e) {
  e.preventDefault();
});

